import styled from "styled-components";

export const MonitorDiv = styled.div`
    display: flex;
    justify-content: space-between;
    background-color: #1E1F21;
    color: #DCDDDD
`

export const MonthYear = styled.span`
    font-size: 32px;
`

export const Month = styled(MonthYear)`
    font-weight: bold;
`
